  root: {
    display: 'inline-block',
    height: '100vh',
    width: '500px',
    background: "#efe"
  },
  hide: {
    display: "none",
  },
  closeButton: {
   position: 'absolute',
   right: theme.spacing(1),
   top: theme.spacing(1),
   color: theme.palette.grey[500],
 },
});

const Midbar = props => {
  const classes = useStyles()

  return (
    <div className={props.showMidbar ? classes.root : classes.hide}>
      <IconButton aria-label="close" className={classes.closeButton} onClick={onClose}>
        <CloseIcon />
